// api.js
const API_BASE_URL = 'http://localhost:8080/api';

export const fetchEntities = async () => {
  const response = await fetch(`${API_BASE_URL}`);
  const data = await response.json();
  return data;
};


export const fetchEntries = async (entityName) => {
  const response = await fetch(`${API_BASE_URL}/entities/${entityName}`);
  const data = await response.json();
  return data;
};

export const createEntry = async (entityName, entry) => {
  await fetch(`${API_BASE_URL}/entities/entry`, {
    method: 'POST',
    headers: {
      'Content-Type': 'application/json',
    },
    body: JSON.stringify({ entityName, entry }),
  });
};

export const deleteEntry = async (entityName, entryId) => {
  await fetch(`${API_BASE_URL}/entities/${entityName}/${entryId}`, {
    method: 'DELETE',
  });
};
